import { createActionTypes } from "../utils";

export const LoginActions = createActionTypes("login", [
  "LOGIN_CLICKED"
]);

export const onLogin = (data) => ({
    type: LoginActions.LOGIN_CLICKED,
    payload: {
      ...data
    }
  });
